import "./TileArea.css";
import User from "./User";
import UserJob from "./UserJob";
import UserHobby from "./UserHobby";

function TileArea(props) {
  return (
    <div className="eachTile">
      <div className="tile">
        <TileArea
          name={props[0].name}
          job={props[0].job}
          hobby={props[0].hobby}
        />
        <TileArea
          name={props[1].name}
          job={props[1].job}
          hobby={props[1].hobby}
        />
        <TileArea
          name={props[2].name}
          job={props[2].job}
          hobby={props[2].hobby}
        />
        <TileArea
          name={props[3].name}
          job={props[3].job}
          hobby={props[3].hobby}
        />
        <TileArea
          name={props[4].name}
          job={props[4].job}
          hobby={props[4].hobby}
        />
        <TileArea
          name={props[5].name}
          job={props[5].job}
          hobby={props[5].hobby}
        />
      </div>

      {/* <h2>TITLE</h2>
      <p>This is the thing that I'm trying to display</p>
      <User name={props.name} />
      <UserJob job={props.job} />
      <UserHobby hobby={props.hobby} /> */}
    </div>
  );
}

export default TileArea;
